import torch
from transformers import AutoTokenizer, AutoModel,AutoModelForSequenceClassification
from peft import PeftModel
tokenizer = AutoTokenizer.from_pretrained("./Trained_model",trust_remote_code=True)
model = AutoModelForSequenceClassification.from_pretrained("./Trained_model", trust_remote_code=True)

dna=""
input=tokenizer(dna, return_tensors = 'pt',truncation=True, max_length=128)["input_ids"]
output=model(input)
logits = output.logits
predicted_classes = torch.argmax(logits, dim=-1)
print("Predicted classes:", predicted_classes)